Action: Generate a responsive contact form using HTML and CSS. 

HTML Code:
<form class="contact-form" action="/submit" method="POST">
  <h2>Contact Me</h2>
  <div class="form-group">
    <label for="name">Name:</label>
    <input type="text" id="name" name="name" required>
  </div>
  <div class="form-group">
    <label for="email">Email:</label>
    <input type="email" id="email" name="email" required>
  </div>
  <div class="form-group">
    <label for="message">Message:</label>
    <textarea id="message" name="message" rows="4" required></textarea>
  </div>
  <button type="submit">Send Message</button>
</form>

CSS Code:
.contact-form {
  max-width: 600px;
  margin: 2rem auto;
  padding: 2rem;
  background: #f5f5f5;
  border-radius: 8px;
}

.form-group {
  margin-bottom: 1.5rem;
}

label {
  display: block;
  margin-bottom: 0.5rem;
  font-weight: bold;
}

input, textarea {
  width: 100%;
  padding: 0.5rem;
  border: 1px solid #ddd;
  border-radius: 4px;
  box-sizing: border-box;
}

button {
  background: #007bff;
  color: white;
  padding: 0.75rem 1.5rem;
  border: none;
  border-radius: 4px;
  cursor: pointer;
}

button:hover {
  background: #0056b3;
}

@media (max-width: 480px) {
  .contact-form {
    margin: 1rem;
    padding: 1rem;
  }
}

Verbal Explanation: "I created a contact form with name, email, and message fields. The form uses HTML inputs and a textarea, with 'required' attributes to enforce mandatory fields. The CSS styles it for a clean look, with max-width to prevent stretching on large screens and padding for spacing. On mobile (screens under 480px), the form adjusts margins and padding for better fit. The button has a hover effect for interactivity. You can update the 'action' attribute to your form submission endpoint and customize colors or spacing as needed. Let me know if you want to add features like validation messages or a CAPTCHA!"
}

